const Test1 = (props) => {
    const listStuff = props.stuff.stufflist.map(ele => <li>{ele}</li>)
    return (
        <>
            <h4>{props.stuff.title}</h4>
            <h4>{props.stuff.title}</h4>
            <ul>
                <>{listStuff}</>
            </ul>
        </>
    )
}
export default Test1
